import styles from './Input.module.css'

const Input = () => {
  return (
    <div className={styles.input_container}>
      <label htmlFor='title'> Title: </label>
      <input type="text" name="title" id="title" placeholder='Enter with a title for the thought!' />
      <label>Description:</label>
      <textarea name="description" id="description" placeholder='Enter with a description for the thought!'></textarea>
    </div>
  )
}

export default Input
